$(document).ready(function(){$("html").niceScroll()}),$.fn.moveIt=function(){var t=$(window),e=[];$(this).each(function(){e.push(new moveItItem($(this)))}),window.onscroll=function(){var o=t.scrollTop();e.forEach(function(t){t.update(o)})}};var moveItItem=function(t){this.el=$(t),this.speed=parseInt(this.el.attr("data-scroll-speed"))};moveItItem.prototype.update=function(t){var e=t/this.speed;this.el.css("transform","translateY("+-e+"px)")},$(function(){$("[data-scroll-speed]").moveIt()});